import styled from "styled-components";

const AppWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  margin: 30px;
`;

const ContentWrapper = styled.div`
  display: flex;
  justify-content: center;
  background-color: #f8f8f8;
  margin: 30px;
  height: 100vh;
`;

export { AppWrapper, ContentWrapper };
